import React, { useRef, useEffect, useState } from "react";
const Sidebar = ({ musicList }) => {

    const [artists, setArtists] = useState([])

    useEffect(() => {
        musicList.music.map(({ artist }, key) => {
            setArtists([...artists, artist])
            console.log(artist)
        })
    })


    return (
        <div className="sidebar">
            <ul className="nav flex-column border-bottom border-secondary pb-3">
                <li className="nav-item">
                    <button type="button" className="btn btn-outline-secondary mt-3 ml-4">My Music</button>
                </li>
            </ul>
            <ul className="nav flex-column mt-3 ml-4">
                <li className="nav-item">
                    <a className="">Link</a>
                </li>
                <li className="nav-item">
                    <a className="">Link</a>
                </li>
            </ul>

        </div>
    )
}

export default Sidebar;
